          var embed = new EmbedBuilder()
            .setColor(`${config.color.color_verif_stop}`)
            .setDescription(`${emoji.bin}${general.response.desactivate_free}`)
          message.reply({ embeds: ([embed]) })

          await message.guild.channels.delete(message.guild.channels.cache.find((channel) => channel.name === 'üì°„Éªeclipse-host'))
